webpackJsonp([0x9cc4ea1e7f2e],{6833:function(e,t){e.exports={data:{post:{html:'<p>In citing a rant about <a title="Eamonn Fitzgerald\'s Rainy Day: German anti-Americanism redux" href="http://www.eamonn.com/archives/001354.html#001354">the anti-American German press</a> (ironically, from a German journalist in the German press), Eamonn makes the assertion (common among warbloggers) that "only by cynical Bush-baiting (did Schröder) manage to cling to power".</p>\n<p>I\'m just wondering, is there any political data to either back this up or refute this?  My gut feeling is that this is not directly true, as Stoiber did not present a clear alternative on Iraq (in fact, in the end, <a href="http://www.papascott.de/2002/09/19/1887.php">he was even more anti-war than Schröder</a>). But are there any polls or analyses on the effect of the Iraq issue on the 2002 election?</p>',fields:{title:"",date:"27 May 2004",url:"https://papascott.de/2004-05-27-how-did-schroeder-win/"}}},pathContext:{slug:"/2004-05-27-how-did-schroeder-win/",prev:{fields:{title:"Health Insurance",date:"27 May 2004",slug:"/2004-05-27-health-insurance/"}},next:{fields:{title:"Simultaneous Translation",date:"28 May 2004",slug:"/2004-05-28-simultaneous-translation/"}}}}}});
